import React, { Component } from 'react';
import {
  View,
  Platform,
  TextInput,
  FlatList,
  Item,
  Text,
  StyleSheet
} from 'react-native';


export default function Calendar() {
    return (
      <View>
      <FlatList
      numColumns={7}
      //data={[{"jour": "jour1", "date": "27 Feb"}, "jour2", "jour3", "jour4", "jour5", "jour6", "jour7"]}
      data={[
        {"jour": "MA", "date": "fevr. 08", "availabilities": ['-', '-', '-', '-']}, 
        {"jour": "ME", "date": "fevr 09",  "availabilities": ['-', '-', '-', '-']}, 
        {"jour": "JE", "date": "fevr. 10", "availabilities": ['-', '15h30', '-', '-']}
        ]}
      //data = {props.items}
      horizontal={false}
      renderItem={(test) => {
        return (
        <View style={styles.calendar}>
        <Text style={styles.jour}> {test.item.jour} </Text>
        <Text style={styles.date}> {test.item.date} </Text>
        <Availabilities data={test.item.availabilities}/>
        </View>
        )
      }}
      />
      </View>
      )
}

function Availabilities(props) {
  return (
    <View>
    <FlatList
    data={props.data}
    horizontal={false}
    renderItem={(test) => {
      return (
        <Text style={styles.nobooking}> {test.item} </Text>
      )
    }}
    >
    </FlatList>
    </View>
  )
}

export class Welcome extends React.Component {
  render() {
    return <Text>Bonjour</Text>;
  }
}

const styles = StyleSheet.create({
  date: {
    backgroundColor: "white",
    borderWidth: 0,
    borderColor: "#333",
    padding: 0,
  },
  jour: {
    backgroundColor: "white",
    borderWidth: 0,
    borderBottomColor: "red",
    borderColor: "#333",
    padding: 0,
  },
  nobooking: {
    backgroundColor: "white",
    borderWidth: 0,
    borderBottomColor: "red",
    borderColor: "#333",
    padding: 0,
  },
  calendar: {
    fontFamily: "sans-serif",
    fontSize: "12"
  }
});
